def in_list(list_of_lists, item):
    for list_ in list_of_lists:
        if item in list_:
            return True
    return False

def find_missing(s,I):
    values = range(0, I, 1)
    missing = []
    for v in values:
        if not in_list(s, v):
            missing.append(v)
    return missing

def find_missing_pairs(stages,I):
    s = find_missing(stages,I)
    pairs = []
    while s:
        pairs.append([s.pop(0),s.pop()])
    return pairs


